import React from 'react';
import "./Header.css";


const Header = props => (

    <div id="header">
        <div id="title">Do You Remember</div>
        <div id="directions">Don't click the same image twice!</div>
        <div id="scoreDiv">Score: {props.score}</div>
    </div>
);



export default Header
